/** @format */

import React from "react";
import App from "./App";
import WrapperProvider from "./context/itemmovie-context";

import { render } from 'react-dom';
const container = document.getElementById('app');
render(
  <React.StrictMode>
     <WrapperProvider>
       <App />, {container})
     </WrapperProvider>
  </React.StrictMode>
;
